import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Balance from './balance';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

export default function FullWidthGrid() {
  const classes = useStyles();

  return (
    <div className="">
      <Grid container
            direction="row"
            justify="space-evenly"
            alignItems="centers"spacing={3}>
        <Grid item xs={10} sm={10} md={10} lg={15}>
        </Grid>
        <Grid item xs={11} sm={11} md={11} lg={11}>
          <Balance/>
        </Grid>
        <Grid item xs={3} sm={3} md={3} lg={3}>
          <Paper className={classes.paper}> 2nd xs=5 sm=3</Paper>
        </Grid>
        <Grid item xs={3} sm={3} md={3} lg={3}>
          <Paper className={classes.paper}> 3rd xs=5 sm=3</Paper>
        </Grid>
        <Grid item xs={3} sm={3} md={3} lg={3}>
          <Paper className={classes.paper}>4th xs=6 sm=3</Paper>
        </Grid>
      </Grid>
    </div>
  );
}
